import "./Product.scss";

const Product = () => {
	return (
		<div className="product">
			<div className="left">
				<div className="filterItem">
					<h2>Product Categories</h2>
				</div>
				<div className="filterItem">
					<h2>Filter by price</h2>
				</div>
				<div className="filterItem">
					<h2>Sort by</h2>
				</div>
			</div>
			<div className="right"></div>
		</div>
	);
};

export default Product;
